import React from 'react'
import Users from './Users'
import Blogs from './Blogs'
import BlogWithName from './BlogWithName'

export default function InfoPanel({info}) {
  return (
    <div>
      {info === 'Users' ? <Users/> : <Users/>}
      {info === 'Blogs' ? <Blogs/> : <Users/>}
      {info === 'Blog with Name' ? <BlogWithName/> : <Users/>}
    </div>
  )
}
